import React, { useContext } from "react";
import { Link } from "react-router-dom";
import { createBrowserHistory } from "history";
import logo from "../../img/logo.png";
import { GlobalContext } from "../../context/GlobalState";
import me from "../../img/me.png";

const Navigation = () => {
  const { isLoggedIn, user_info, logOutUser } = useContext(GlobalContext);
  // console.log(localStorage.hasOwnProperty("PLUD"));

  const history = createBrowserHistory();

  const navItems = [
    {
      name: "Home",
      link: "/",
    },
    {
      name: "Book a Photographer",
      link: "/book-a-photographer",
    },
    {
      name: "Contact Us",
      link: "/contact-us",
    },
  ];

  return (
    <header id="utf-header-container-block">
      <div id="header">
        <div class="container">
          <div class="utf-left-side">
            <div id="logo">
              {" "}
              <a href="index.html">
                <img src="images/logo.png" alt="" />
              </a>{" "}
            </div>
            <nav id="navigation">
              <ul id="responsive">
                <li class="active">
                  <a href="index.html" class="current">
                    Home
                  </a>
                </li>
                <li>
                  <a href="photographer-list.html">Book A Photographer</a>
                </li>
                <li>
                  <a href="contact.html">Contact Us</a>
                </li>
              </ul>
            </nav>
            <div class="clearfix"></div>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Navigation;
